import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import { series } from "./seriesInfo";

ReactDOM.render(
  <>
    <div className="heading">Best Series on Netflix and Amazon</div>

    <div className="cardContainer">
      <Card
        imgsrc={series[0].image}
        title={series[0].title}
        Sname={series[0].Sname}
        link={series[0].link}
      />
      <Card
        imgsrc={series[1].image}
        title={series[1].title}
        Sname={series[0].Sname}
        link={series[0].link}
      />
      <Card
        imgsrc={series[0].image}
        title={series[0].title}
        Sname={series[0].Sname}
        link={series[0].link}
      />
    </div>
  </>,
  document.getElementById("root")
);
